import axios from 'axios'
import actionTypes from "./action-types"

export function loadUsers(){
    console.log('I am in actions');
    fetch("http://localhost:3000/api/users/", {method:"get"}).then((list)=>{
        console.log(list)
    })
    dispatcher.dispatch({
        type: actionTypes.USERS_LIST,
        data: [{users: 'pepito'}],   
